# pobranie embeddingów i odpowiadających im etykiet
X, y = [], []
for url, label in data:
    emb = get_embedding(url) # ekstrakcja embeddingu twarzy
    if emb is not None: 
        X.append(emb) # dodanie embeddingu do zbioru cech
        y.append(label) # dodanie odpowiadającej etykiety

# kodowanie etykiet
le = LabelEncoder()
y_encoded = le.fit_transform(y)

# podział danych na zbiór treningowy i testowy (z zachowaniem proporcji klas)
X_train, X_test, y_train, y_test = train_test_split(
    X, y_encoded, test_size=0.4, random_state=1, stratify=y_encoded
)

# klasa PyTorch do reprezentacji datasetu embeddingów
class EmbeddingDataset(Dataset):
    def __init__(self, X, y):
        self.X = torch.tensor(X, dtype=torch.float32)
        self.y = torch.tensor(y, dtype=torch.long)
    def __len__(self):
        return len(self.X)
    def __getitem__(self, idx):
        return self.X[idx], self.y[idx]

# utworzenie datasetów treningowego i testowego
train_dataset = EmbeddingDataset(X_train, y_train)
test_dataset = EmbeddingDataset(X_test, y_test)

# załadowanie danych do DataLoaderów
train_loader = DataLoader(train_dataset, batch_size=9, shuffle=True)
test_loader = DataLoader(test_dataset, batch_size=3, shuffle=False)

# definicja sieci neuronowej
class ClassifierNN(nn.Module):
    def __init__(self, input_size, num_classes):
        super(ClassifierNN, self).__init__()
        self.net = nn.Sequential(
            nn.Linear(input_size, 256), # warstwa wejściowa
            nn.ReLU(),
            nn.Dropout(0.3),
            nn.Linear(256, 128), # warstwa ukryta
            nn.ReLU(),
            nn.Dropout(0.3),
            nn.Linear(128, num_classes) # warstwa wyjściowa
        )

    def forward(self, x):
        return self.net(x)

# inicjalizacja modelu, funkcji kosztu i optymalizatora
model = ClassifierNN(input_size=512, num_classes=len(le.classes_)).to(device)
criterion = nn.CrossEntropyLoss()
optimizer = optim.Adam(model.parameters(), lr=0.001)

# trening modelu z walidacją i mechanizmem wczesnego zatrzymania (early stopping)
epochs = 50
best_val_acc = 0
patience = 5
patience_counter = 0

# trening
for epoch in range(epochs):
    model.train()
    train_loss, train_correct = 0, 0

    for inputs, labels in train_loader:
        inputs, labels = inputs.to(device), labels.to(device)
        optimizer.zero_grad()
        outputs = model(inputs)
        loss = criterion(outputs, labels)
        loss.backward()
        optimizer.step()

        train_loss += loss.item() * inputs.size(0)
        train_correct += (outputs.argmax(dim=1) == labels).sum().item()

    train_loss /= len(train_dataset)
    train_acc = train_correct / len(train_dataset)

    # walidacja
    model.eval()
    val_loss, val_correct = 0, 0
    with torch.no_grad():
        for inputs, labels in test_loader:
            inputs, labels = inputs.to(device), labels.to(device)
            outputs = model(inputs)
            loss = criterion(outputs, labels)
            val_loss += loss.item() * inputs.size(0)
            val_correct += (outputs.argmax(dim=1) == labels).sum().item()

    val_loss /= len(test_dataset)
    val_acc = val_correct / len(test_dataset)

    print(f"Epoka [{epoch+1}/{epochs}] - train_acc: {train_acc:.2f}, val_acc: {val_acc:.2f}")

    # early stopping
    if val_acc > best_val_acc:
        best_val_acc = val_acc
        patience_counter = 0
        best_model_state = model.state_dict()  # zapisanie najlepszego modelu
    else:
        patience_counter += 1
        if patience_counter >= patience:
            print("Wczesne zatrzymanie.")
            break

# wczytanie najlepszego modelu
model.load_state_dict(best_model_state)

# ewaluacja na zbiorze uczącym (training set)
model.eval()
y_train_true, y_train_pred = [], []
with torch.no_grad():
    for inputs, labels in train_loader:
        inputs, labels = inputs.to(device), labels.to(device)
        outputs = model(inputs)
        preds = outputs.argmax(dim=1)
        y_train_true.extend(labels.cpu().numpy())
        y_train_pred.extend(preds.cpu().numpy())

train_acc_final = accuracy_score(y_train_true, y_train_pred)
print(f"✅ Trafność na zbiorze uczącym: {train_acc_final:.2f}")

# macierz pomyłek dla zbioru uczącego
