            boxes, scores = detect_faces(image_np)

            for (x1, y1, x2, y2), score in zip(boxes, scores):
                if score > 0.5:
                    cv2.rectangle(image_np, (x1, y1), (x2, y2), (0, 255, 0), 2)

            col = st.columns([1,2,1])
            col[1].image(image_np, use_container_width=True)

